import React, { useState, useEffect, useCallback } from 'react';
import { MapContainer, TileLayer, Marker, Popup, Polyline } from 'react-leaflet';
import L from 'leaflet';
import io from 'socket.io-client';
import 'leaflet/dist/leaflet.css';

// Define vehicle styles for different vehicle IDs
const vehicleStyles = {
  vehicle1: { 
    icon: L.icon({
      iconUrl: '/images/tractor_2548747.png', // Image icon for vehicle1
      iconSize: [32, 32],
      iconAnchor: [16, 32],
      popupAnchor: [0, -32]
    }),
    pathColor: 'blue'
  },
  vehicle2: { 
    icon: L.icon({
      iconUrl: '/images/tractor-color-icon.png',
      iconSize: [32, 32],
      iconAnchor: [16, 32],
      popupAnchor: [0, -32]
    }),
    pathColor: 'red'
  },
  vehicle3: { 
    icon: L.icon({
      iconUrl: '/images/vecteezy_construction-vehicle-3d-render-clipart_31614137.png',
      iconSize: [32, 32],
      iconAnchor: [16, 32],
      popupAnchor: [0, -32]
    }),
    pathColor: 'green'
  }
};

const defaultStyle = {
  icon: L.icon({
    iconUrl: '/images/tractor_2548747.png',
    iconSize: [32, 32],
    iconAnchor: [16, 32],
    popupAnchor: [0, -32]
  }),
  pathColor: 'red'
};

// Set initial vehicle data with starting coordinates so markers show immediately on the map
const initialVehicles = {
  vehicle1: {
    id: "vehicle1",
    currentPosition: { lat: 22.317094, lng: 87.314139 },
    timestamp: Date.now()
  },
  vehicle2: {
    id: "vehicle2",
    currentPosition: { lat: 22.315632, lng: 87.315678 },
    timestamp: Date.now()
  },
  vehicle3: {
    id: "vehicle3",
    currentPosition: { lat: 22.318920, lng: 87.313456 },
    timestamp: Date.now()
  }
};

function VehicleTracker() {
  const [vehicles, setVehicles] = useState(initialVehicles);
  // trackedPaths will store historical positions for each vehicle as an array
  const [trackedPaths, setTrackedPaths] = useState({});

  // Helper: Update vehicle data based on the data structure received from Firebase
  const updateSingleVehicle = (vehicleData) => {
    // vehicleData should have keys "current" and "path"
    setVehicles(prevVehicles => {
      const newVehicles = { ...prevVehicles };
      const key = vehicleData.id;
      newVehicles[key] = {
        id: vehicleData.id,
        name: vehicleData.name || vehicleData.id,
        currentPosition: vehicleData.current, // Use the "current" key
        lastUpdateTime: Date.now()
      };
      return newVehicles;
    });

    // Convert the path object into an array
    setTrackedPaths(prevPaths => {
      const newPaths = { ...prevPaths };
      const key = vehicleData.id;
      if (vehicleData.path) {
        // Convert the path object into an array of positions
        newPaths[key] = Object.values(vehicleData.path);
      }
      return newPaths;
    });
  };

  // Callback to update vehicle positions.
  // Expecting data in the format: { vehicle1: { current: {...}, path: { key1: {...}, ... } } }
  const updateVehiclePosition = useCallback((data) => {
    if (!data) return;
    if (data.vehicle1) {
      updateSingleVehicle({ id: "vehicle1", ...data.vehicle1 });
    }
    // Extend here for other vehicles if needed
  }, []);

  useEffect(() => {
    // Create the Socket.IO connection to the backend.
    const socket = io('http://localhost:8080');
    socket.on('gpsData', updateVehiclePosition);
    return () => {
      socket.disconnect();
    };
  }, [updateVehiclePosition]);

  return (
    <MapContainer 
      center={[22.346010, 87.315221]} 
      zoom={13} 
      style={{ height: '500px', width: '100%' }}
    >
      <TileLayer
        url="https://tile.openstreetmap.org/{z}/{x}/{y}.png"
        attribution='&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'
      />
      {Object.keys(vehicles).map(id => {
        const vehicle = vehicles[id];
        const path = trackedPaths[id] || [];
        const style = vehicleStyles[id] || defaultStyle;
        const pos = vehicle.currentPosition;
        if (!pos || pos.lat == null || pos.lng == null) return null;
        // Filter the historical positions array for valid coordinates.
        const positions = path.filter(p => p && p.latitude != null && p.longitude != null)
                              .map(p => [p.latitude, p.longitude]);
        return (
          <React.Fragment key={id}>
            {positions.length > 1 && (
              <Polyline 
                positions={positions} 
                color={style.pathColor} 
                weight={3}
              />
            )}
            <Marker position={[pos.lat, pos.lng]} icon={style.icon}>
              <Popup>
                <strong>{vehicle.name}</strong><br/>
                Last Update: {new Date(vehicle.lastUpdateTime).toLocaleString()}
              </Popup>
            </Marker>
          </React.Fragment>
        );
      })}
    </MapContainer>
  );
}

export default VehicleTracker;
